function App() {
    return ( <
            >
            <
            Router >
            <
            Navbar / >
            <
            Routes >
            <
            Route exact path = '/'
            element = { < Home / > }
            /> <
            Route exact path = '/movies/popular'
            element = { < MovieList categories = "popular" / > }
            /> <
            Route exact path = '/movies/toprated'
            element = { < h1 > toprated < /h1>}/ >
                <
                Route exact path = '/movies/toprated'
                element = { < h1 > toprated < /h1>}/ >
                    <
                    Route exact path = '/movies/upcoming'
                    element = { < h1 > upcoming < /h1>}/ >
                        <
                        /Routes> <
                        /Router> <
                        />
                    );
                }

                export default App;
